import React, { useState } from 'react';
import { useHistory } from 'react-router-dom';
import COMPANY_DEPT from '../data/companyDepartments';
import US_STATES from '../data/usStates';

const RegisterForm = () => {
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [dateOfBirth, setdateOfBirth] = useState('');
    const [startDate, setStartDate] = useState('');
    const [street, setStreet] = useState('');
    const [city, setCity] = useState('');
    const [state, setState] = useState('');
    const [zipCode, setZipCode] = useState('');
    const [department, setDepartment] = useState('');

    const submitForm = (e) => {
        e.preventDefault();

        // Get the form data
        const formData = new FormData(e.target);

        // Create an object to store the form data
        const formValues = {};
        for (let [key, value] of formData.entries()) {
            formValues[key] = value;
        }

        // Get the existing form data from localStorage (if any)
        const formDataJSON = localStorage.getItem('formData');
        let formDataArray = [];
        if (formDataJSON) {
            try {
                formDataArray = JSON.parse(formDataJSON);
                if (!Array.isArray(formDataArray)) {
                    formDataArray = [];
                }
            } catch (error) {
                console.error('Error parsing formDataJSON:', error);
            }
        }

        // Add the new form data to the array
        formDataArray.push(formValues);

        // Save the updated form data array to localStorage
        localStorage.setItem('formData', JSON.stringify(formDataArray));

        // Clear the form inputs
        e.target.reset();
        const history = useHistory();
        history.push('/CurrentEmployee');
    };

    return (
        <form onSubmit={submitForm}>
            <div>
                <label htmlFor="firstName">First Name</label>
                <input
                    type="text"
                    id="firstName"
                    value={firstName}
                    onChange={(e) => setFirstName(e.target.value)}
                    required
                />
            </div>
            <div>
                <label htmlFor="lastName">Last Name</label>
                <input
                    type="text"
                    id="lastName"
                    value={lastName}
                    onChange={(e) => setLastName(e.target.value)}
                    required
                />
            </div>
            <div>
                <label htmlFor="dateOfBirth">Date of Birth</label>
                <input
                    type="date"
                    id="dateOfBirth"
                    value={dateOfBirth}
                    onChange={(e) => setdateOfBirth(e.target.value)}
                    required
                />
            </div>
            <div>
                <label htmlFor="startDate">Start Date</label>
                <input
                    type="date"
                    id="startDate"
                    value={startDate}
                    onChange={(e) => setStartDate(e.target.value)}
                    required
                />
            </div>
            <div>
                <label>Address</label>
                <div>
                    <label htmlFor="street">Street</label>
                    <input
                        type="text"
                        id="street"
                        value={street}
                        onChange={(e) => setStreet(e.target.value)}
                        required
                    />
                </div>
                <div>
                    <label htmlFor="city">City</label>
                    <input
                        type="text"
                        id="city"
                        value={city}
                        onChange={(e) => setCity(e.target.value)}
                        required
                    />
                </div>
                <div>
                    <label htmlFor="state">State</label>
                    <select
                        id="state"
                        value={state}
                        onChange={(e) => setState(e.target.value)}
                    >
                        <option value="">Select a state</option>
                        {US_STATES.map((state) => (
                            <option key={state} value={state}>
                                {state}
                            </option>
                        ))}
                    </select>
                </div>
                <div>
                    <label htmlFor="zipCode">Zip Code</label>
                    <input
                        type="text"
                        id="zipCode"
                        value={zipCode}
                        onChange={(e) => setZipCode(e.target.value)}
                        required
                    />
                </div>
            </div>
            <div>
                <label htmlFor="department">Department</label>
                <select
                    id="department"
                    value={department}
                    onChange={(e) => setDepartment(e.target.value)}
                    required
                >
                    <option value="">Select a dpt</option>
                    {COMPANY_DEPT.map((department) => (
                        <option key={department} value={department}>
                            {department}
                        </option>
                    ))}
                </select>
            </div>
            <button type="submit">Save</button>
        </form>
    );
};

export default RegisterForm;
